import React, { useState } from "react";
import { Link } from "react-router-dom";
import styled from "styled-components";


// 헤더 컨테이너 스타일
const HeaderContainer = styled.div`
  position: sticky;
  background: #000000;
  height : 500px;
  color: white;
  padding-left: 32px;
  padding-right: 32px;
  display: flex;
  justify-content: space-between;
  align-items: center;
`;

const LinkContainer = styled.div`
  display: flex;
  align-items: center;
  padding: 0.7vw;
`

const LinkItem = styled(Link)`
  color: #ffffff;
  text-decoration: none;
  font-weight: bold;

`;

const Header = () => {

    return (
        <HeaderContainer>
        <LinkContainer>
          <LinkItem to="/about">ABOUT</LinkItem>
          <LinkItem to="/recruit">모집안내</LinkItem>
          <LinkItem to="/project">프로젝트</LinkItem>
          </LinkContainer>
        </HeaderContainer>
    );
};

export default Header;
